import React, {Component} from 'react'

class Header extends Component {
    render() {
        return (
            <div className="container">
                <ul>
                    <li><a href="">Register</a></li>
                    <li><a href="">Login</a></li>
                </ul>
            </div>
        )
    }
}

export default Header
